// MyComponent.js
import React, {useState} from 'react';
import Draggable from 'react-draggable';

const TrainerSettingsWindow = () => {
    
    const [isVisible, setIsVisible] = useState(true);
    const [inputValues, setInputValues] = useState({ input1: 0.0, input2: 0.0 });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setInputValues((prevValues) => ({ ...prevValues, [name]: value }));
    };
    const toggleVisibility = () => {
        setIsVisible(!isVisible);
    };
     
    return (
        isVisible && (
            <Draggable>
                <div style={{ width: 200, height: 100, padding: 10, 
                    backgroundColor: '#f0f0f0', cursor: 'move', position: 'relative', 
                    borderRadius: '8px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' }}>
                    <button onClick={toggleVisibility} style={{
                    position: 'absolute',
                    top: '10px',
                    right: '10px',
                    border: 'none',
                    background: 'none',
                    cursor: 'pointer',
                    width: '24px',
                    height: '24px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    borderRadius: '12px',
                    backgroundColor: '#ccc',
                    boxShadow: '0 2px 4px rgba(0,0,0,0.2)'
                    }}>
                    <span style={{ color: 'white', fontWeight: 'bold' }}>Ã—</span>
                    </button>
                    <div className="input-group">
                <label htmlFor="input1">Input 1:</label>
                <input type="number" step="0.1" name="input1" id="input1" value={inputValues.input1} onChange={handleInputChange} />
                </div>
                <div className="input-group">
                <label htmlFor="input2">Input 2:</label>
                <input type="number" step="0.1" name="input2" id="input2" value={inputValues.input2} onChange={handleInputChange} />
                </div>
                </div>
            </Draggable>
        )
    );
    
};

export default TrainerSettingsWindow;
